/*Table structure for table `tb_sys_config` */

DROP TABLE IF EXISTS `tb_sys_config`;

CREATE TABLE `tb_sys_config` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '配置ID',
  `title` char(30) NOT NULL DEFAULT '' COMMENT '配置名称',
  `name` char(30) NOT NULL DEFAULT '' COMMENT '配置标记',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '0:数组,1:字符串,2:整型,3:布尔',
  `value` varchar(255) NOT NULL COMMENT '配置值',
  `extra` varchar(200) NOT NULL DEFAULT '' COMMENT '选择类型的参数',
  `remark` varchar(100) NOT NULL COMMENT '备注',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态',
  `sort` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `groups` tinyint(3) DEFAULT NULL COMMENT '分组配置',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8;

/*Data for the table `tb_sys_config` */

