  `serverip` varchar(32) NOT NULL DEFAULT '' COMMENT '路由器IP',
  `mark` varchar(32) NOT NULL DEFAULT '' COMMENT '描述',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'vpn状态',
  `addtime` datetime DEFAULT NULL COMMENT '添加时间',
  `adduser` varchar(32) NOT NULL DEFAULT '' COMMENT '添加人',
  `region` varchar(255) NOT NULL DEFAULT '0' COMMENT '可用区域 多选 逗号分割',
  `reigonname` varchar(1000) DEFAULT NULL,
  `conn` int(11) NOT NULL DEFAULT '0' COMMENT '并发连接',
  `userlevel` tinyint(1) NOT NULL DEFAULT '1' COMMENT '用户级别',
  `vpnport` int(11) NOT NULL DEFAULT '1723' COMMENT 'vpn端口',
  `ipsec` varchar(255) NOT NULL DEFAULT '' COMMENT 'ipsec key',
  `connmode` varchar(32) NOT NULL DEFAULT '0' COMMENT '连接模式 ',
  `modename` varchar(32) NOT NULL DEFAULT '' COMMENT '模式名称',
  `password` varchar(32) NOT NULL DEFAULT '' COMMENT '密码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

