/*Table structure for table `tb_vpn_user` */

DROP TABLE IF EXISTS `tb_vpn_user`;

CREATE TABLE `tb_vpn_user` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `account` varchar(64) NOT NULL DEFAULT '' COMMENT '账号可修改为手机号',
  `ismobile` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否修改为手机号',
  `password` varchar(32) NOT NULL DEFAULT '' COMMENT '密码',
  `regtime` datetime DEFAULT NULL COMMENT '注册时间',
  `channelid` varchar(32) NOT NULL DEFAULT '' COMMENT '来源渠道id',
