  `loginnum` int(11) NOT NULL DEFAULT '1' COMMENT '登录次数',
  `oldcount` varchar(32) NOT NULL DEFAULT '' COMMENT '原账号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uniqueid` (`account`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

